import React from 'react';
import logo from '../assests/basilurlogo.png'; // Import the logo

const AddFreightAgent = () => {
  return (
    <div
      className="font-sans min-h-screen flex flex-col justify-between"
      style={{
        backgroundColor: '#FFFFFF', // White background for the body
      }}
    >
      {/* Header */}
      <header
        className="flex items-center justify-center p-2 mx-auto"
        style={{
          backgroundColor: '#191919', // Black header background
          color: '#FFFFFF', // White font color
          borderRadius: '30px', // Rounded corners
          height: '50px', // Smaller header height
          width: '85%', // Narrower width
          marginTop: '20px', // Space from top
          boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)', // Subtle shadow
        }}
      >
        {/* Logo inside the header */}
        <img
          src={logo}
          alt="Logo"
          className="mr-4"
          style={{
            width: '40px', // Reduced logo size
            height: '40px',
            objectFit: 'contain',
          }}
        />

        {/* Title centered in the header */}
        <h1
          className="text-lg font-bold flex-1 text-center"
          style={{
            color: '#FFFFFF', // White text color
          }}
        >
          Freight Allocation
        </h1>
      </header>

      {/* Main Content */}
      <main className="flex-1 flex justify-center items-center">
        <div
          className="p-8 rounded-lg shadow-lg w-96"
          style={{
            background: '#FFFFFF', // Solid white background
            borderRadius: '16px', // Rounded corners
            border: '1px solid rgba(25, 25, 25, 0.1)', // Subtle border
            boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)', // Subtle shadow
          }}
        >
          <h2
            className="text-2xl mb-6 font-semibold"
            style={{
              color: '#191919', // Black text for the title
              textAlign: 'center',
            }}
          >
            Add Freight Agent
          </h2>
          <form className="flex flex-col">
            {/* Name */}
            <div className="mb-4">
              <label
                htmlFor="name"
                className="block mb-2 text-sm"
                style={{ color: '#191919' }}
              >
                Name:
              </label>
              <input
                type="text"
                id="name"
                name="name"
                className="w-full p-3 border rounded-md text-sm"
                style={{
                  borderColor: '#191919', // Black border
                  backgroundColor: '#FFFFFF', // White input background
                  color: '#191919', // Black input text
                }}
              />
            </div>

            {/* Address */}
            <div className="mb-4">
              <label
                htmlFor="address"
                className="block mb-2 text-sm"
                style={{ color: '#191919' }}
              >
                Address:
              </label>
              <input
                type="text"
                id="address"
                name="address"
                className="w-full p-3 border rounded-md text-sm"
                style={{
                  borderColor: '#191919',
                  backgroundColor: '#FFFFFF',
                  color: '#191919',
                }}
              />
            </div>

            {/* Contact Number */}
            <div className="mb-4">
              <label
                htmlFor="contactNumber"
                className="block mb-2 text-sm"
                style={{ color: '#191919' }}
              >
                Contact Number:
              </label>
              <input
                type="text"
                id="contactNumber"
                name="contactNumber"
                className="w-full p-3 border rounded-md text-sm"
                style={{
                  borderColor: '#191919',
                  backgroundColor: '#FFFFFF',
                  color: '#191919',
                }}
              />
            </div>

            {/* Email */}
            <div className="mb-4">
              <label
                htmlFor="email"
                className="block mb-2 text-sm"
                style={{ color: '#191919' }}
              >
                Email:
              </label>
              <input
                type="email"
                id="email"
                name="email"
                className="w-full p-3 border rounded-md text-sm"
                style={{
                  borderColor: '#191919',
                  backgroundColor: '#FFFFFF',
                  color: '#191919',
                }}
              />
            </div>

            {/* Director 01 */}
            <div className="mb-4">
              <label
                htmlFor="director1"
                className="block mb-2 text-sm"
                style={{ color: '#191919' }}
              >
                Director 01 (Contact Number/Email):
              </label>
              <input
                type="text"
                id="director1"
                name="director1"
                className="w-full p-3 border rounded-md text-sm"
                style={{
                  borderColor: '#191919',
                  backgroundColor: '#FFFFFF',
                  color: '#191919',
                }}
              />
            </div>

            {/* Director 02 */}
            <div className="mb-4">
              <label
                htmlFor="director2"
                className="block mb-2 text-sm"
                style={{ color: '#191919' }}
              >
                Director 02 (Contact Number/Email):
              </label>
              <input
                type="text"
                id="director2"
                name="director2"
                className="w-full p-3 border rounded-md text-sm"
                style={{
                  borderColor: '#191919',
                  backgroundColor: '#FFFFFF',
                  color: '#191919',
                }}
              />
            </div>

            <button
              type="submit"
              className="p-3 rounded-md text-lg cursor-pointer border-2 w-full"
              style={{
                borderColor: '#FF4D00', // Orange border
                backgroundColor: '#FF4D00', // Orange background
                color: '#FFFFFF', // White text
                transition: 'background-color 0.3s ease, color 0.3s ease',
              }}
              onMouseOver={(e) => {
                e.target.style.backgroundColor = '#FFFFFF'; // White background on hover
                e.target.style.color = '#FF4D00'; // Orange text on hover
              }}
              onMouseOut={(e) => {
                e.target.style.backgroundColor = '#FF4D00'; // Orange background
                e.target.style.color = '#FFFFFF'; // White text
              }}
            >
              Add Freight Agent
            </button>
          </form>
        </div>
      </main>

      {/* Footer */}
      <footer
        className="p-4 text-center"
        style={{
          backgroundColor: 'transparent', // Transparent background
          color: '#191919', // Black text color
          fontSize: '14px',
          marginTop: '20px',
        }}
      >
        Â© {new Date().getFullYear()} Freight Allocation. All Rights Reserved.
      </footer>
    </div>
  );
};

export default AddFreightAgent;
